import React from "react"
import { makeStyles } from '@material-ui/core/styles';
import { Link } from 'react-router-dom'; 



const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
},

    Page: {
        paddingTop: '1em',
        width: '80%',
        margin: 'auto',
        paddingBottom: '3em',
        height: '100%',
        [theme.breakpoints.down('xs')]: {
            width: '95%',
        },
    },
    TextTitle: {
      fontFamily: 'Raleway, sans-serif',
        fontSize: '2em',
        textAlign: 'left',
        color: 'black',
        margin: 'auto',
        marginBottom:'10px',
        // paddingBottom: '10px',
        // paddingTop: '10px'
    },
    TextTitleSub: {
      fontFamily: 'Raleway, sans-serif',
        fontSize: '1em',
        textAlign: 'left',
        color: 'black',
        margin: 'auto',
        marginBottom:'30px',
        // paddingBottom: '10px',
        // paddingTop: '10px'
    },
    Text: {
        fontFamily: 'Lato, sans-serif',
        fontSize: '1em',
        textAlign: 'left',
        color: '#717C7D',
        marginTop: '0px',
        [theme.breakpoints.down('xs')]: {
            textAlign: 'left',

        },
    },
    TextDescription:{
      color: '#A2ACAB',
    },
    textLinks: {
      // color: theme_mine.palette.secondary.contrastText,
      color: 'black',
      textDecoration: 'none',

    },


}));

function Personalcoding(props) {
  const classes = useStyles();
;

  return (
    <div className={classes.Page}>
      <h1 className={classes.TextTitle}>Coding</h1>
      <h3 className={classes.TextTitleSub}>I have created a few things during the 2019</h3>
      <p></p>
      <p className={classes.Text}><Link className={classes.textLinks} to="/ActivityTracker">iOS Activity Tracker</Link> ■ Swift, Core Data, Core Graphics, User Defaults, Custom View, Delegate, MVC</p>
      <p className={classes.Text}><Link className={classes.textLinks} to="/Calculator">iOS Unit Converter</Link> ■ Swift, User Defaults, Custom View, IBDesignable, IBInspectable, Sketch </p>
      <p className={classes.Text}><Link className={classes.textLinks} to="/StockForecasting">Full Stack Web Application solution to analyze and predict stock price trend</Link> ■ Python, Flask, Docker, Machine Learning Algorithms, MySQL, HTML, JS</p>
      <p className={classes.Text}><Link className={classes.textLinks} to="/Earthquake">Big Data solution to analyze earthquakes</Link> ■ Hadoop, Spark, MapReduce, Tableau, Unix Script, Python, Java</p>
      <p className={classes.Text}><Link className={classes.textLinks}>Website Portfolio</Link>  ■  ReactJS, HTML, JS, CSS</p>

    </div>

  )
}

export default Personalcoding;
